import logo from './logo.svg';
import mainImage from './img/jogadores.png';
import './App.css';
import './Navbar';
import NavBar from './Navbar';

function App() {
  return (
    <div className="App">
      <NavBar/>
      <div className="MainContent">
        <div className="ImageContent">
          <img src={mainImage} alt="Characters playing jokenpo" width="330" height="20"/>
        </div>
      </div>
    </div>
  );
}

export default App;
